import './App.css';
import Login from './components/Login';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Redirect
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/login" render={props => <Login/>}>
            <Login/>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
